                    <link rel="stylesheet" href="/main.css" />
                </head>
                <body>
                    <div className="wrapper">
                        <header>
                            <h1><a href="/breads" className="header">Welcome to BreadCRUD</a></h1>
                        </header>
                        <div className="container">
                            {html.children}
                        </div>
                    </div>
                </body>
            </html>
        )
    }


// export the code to other files
module.exports = Default

